import React from 'react';
import logo from './logo.svg';
import './App.css';
import { TextField } from '@material-ui/core'

function App() {
  return (
    <div className="App" style={{ height:'1000px', width: '100%', backgroundColor: 'gray'}}>

      <div style={{margin: 'auto', marginBottom: '50vh', paddingTop: '300px'}}>
        <p>Typing is the process of writing or inputting text by pressing keys on a typewriter, computer keyboard, cell phone, or calculator. It can be distinguished from other means of text input, such as handwriting and speech recognition. Text can be in the form of letters, numbers and other symbols. The world's first typist was Lillian Sholes from Wisconsin,[1][2] the daughter of Christopher Sholes, who invented the first practical typewriter.</p>
        <TextField 
          style={{ color: 'white' }} 
          id="filled-basic" 
          label="text" 
          multiline
          rows={4}
          variant="filled"
          />

      </div>
    </div>
  );
}

export default App;
